import React, { Component } from 'react'
import './SideNavBar.css'


class ActivityNavBar extends Component {
    render() {
        return (
            <div className="activityNavBar">
                <a href="#">nav1</a>
                <a href="#">nav2</a>
                <a href="#">nav3</a>
                <a href="#">nav4</a> 
            </div>
        )
    }
}

export default ActivityNavBar
